  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0116069 includes chemical,
  discrete sample, physical and profile data collected from NATHANIEL B. PALMER in
  the South Pacific Ocean from 1997-01-13 to 1997-02-11 and retrieved during cruise
  NBP-97-1 and Ross_Sea_320619970113. These data include AMMONIUM, DISSOLVED INORGANIC
  CARBON, DISSOLVED ORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE,
  NITRITE, PARTICULATE ORGANIC CARBON, PARTICULATE ORGANIC NITROGEN, PHOSPHATE, Partial
  pressure (or fugacity) of carbon dioxide, Potential temperature (theta), SALINITY,
  SILICATE and WATER TEMPERATURE. The instruments used to collect these data include
  CTD and bottle. These data were collected by Taro Takahashi and J Marra of Columbia
  University; Lamont-Doherty Earth Observatory as part of the CLIVAR_Ross_Sea_320619970113
  data set.nnThe International CLIVAR Global Ocean Carbon and Repeat Hydrography Program
  carries out a systematic and global re-occupation of select WOCE/JGOFS hydrographic
  sections to quantify changes in storage and transport of heat, fresh water, carbon
  dioxide (CO2), and related parameters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
